"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     National Collaborating Centre for Acute Care. Nutrition support in adults: Oral nutrition support, enteral tube feeding and parenteral nutrition. Methods, evidence &amp; guidance. National Collaborating Centre for Acute Care, London 2006. Available online at: www.nice.org.uk/nicemedia/pdf/cg032fullguideline.pdf (Accessed on January 14, 2010).",
"    </li>",
