var title_f4_7_4218="Childhood immunization schedule 0 to 6 yrs";
var content_f4_7_4218=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F82617%7EPEDS%2F58209&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F82617%7EPEDS%2F58209&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=4\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 676px\">",
"   <div class=\"ttl\">",
"    Recommended immunization schedule for persons aged 0 through 6 years - United States, 2013 (for those who fall behind or start late, see the catch-up schedule)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 656px; height: 816px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This schedule includes recommendations in effect as of January 1, 2013. Any dose not administered at the recommended age should be administered at a subsequent visit, when indicated and feasible. The use of a combination vaccine generally is preferred over separate injections of its equivalent component vaccines. Vaccination providers should consult the relevant Advisory Committee on Immunization Practices (ACIP) statement for detailed recommendations, available online at",
"    <a href=\"file://www.cdc.gov/vaccines/pubs/acip-list.htm\" target=\"_blank\">",
"     www.cdc.gov/vaccines/pubs/acip-list.htm",
"    </a>",
"    . Clinically significant adverse events that follow vaccination should be reported to the Vaccine Adverse Event Reporting System (VAERS) at",
"    <a href=\"file://www.vaers.hhs.gov\" target=\"_blank\">",
"     www.vaers.hhs.gov",
"    </a>",
"    or by telephone, 800-822-7967. Suspected cases of vaccine-preventable diseases should be reported to the state or local health department. Additional information including precautions and contraindications for vaccination is available from the CDC online at",
"    <a href=\"file://www.cdc.gov/vaccines\" target=\"_blank\">",
"     www.cdc.gov/vaccines",
"    </a>",
"    or by telephone, 800-232-4636. This schedule is approved by the ACIP, the American Academy of Pediatrics, the American Academy of Family Physicians, and the American College of Obstetricians and Gynecologists.",
"    <div class=\"footnotes\">",
"     *",
"     <strong>",
"      Hepatitis B (HepB) vaccine:",
"     </strong>",
"     <em>",
"      (Minimum age: birth)",
"     </em>",
"     <br>",
"      -",
"      <strong>",
"       At birth:",
"      </strong>",
"      : Administer monovalent HepB vaccine to all newborns before hospital discharge. For infants born to hepatitis B surface antigen (HBsAg)-positive mothers, administer HepB vaccine and 0.5 mL of hepatitis B immune globulin (HBIG) within 12 hours of birth. These infants should be tested for HBsAg and antibody to HBsAg (anti-HBs) 1 to 2 months after completion of the HepB series, at age 9 through 18 months (preferably at the next well-child visit). If mother's HBsAg status is unknown, within 12 hours of birth administer HepB vaccine to all infants regardless of birth weight. For infants weighing &lt;2000 grams, administer HBIG in addition to HepB within 12 hours of birth. Determine mother's HBsAg status as soon as possible and, if she is HBsAg-positive, also administer HBIG for infants weighing &ge;2000 grams (no later than age 1 week).",
"      <br>",
"       -",
"       <strong>",
"        Doses following the birth dose:",
"       </strong>",
"       The second dose should be administered at age 1 or 2 months. Monovalent HepB vaccine should be used for doses administered before age 6 weeks. Infants who did not receive a birth dose should receive 3 doses of a HepB-containing vaccine on a schedule of 0, 1 to 2 months, and 6 months starting as soon as feasible. The minimum interval between dose 1 and dose 2 is 4 weeks and between dose 2 and 3 is 8 weeks. The final (third or fourth) dose in the HepB vaccine series should be administered no earlier than age 24 weeks, and at least 16 weeks after the first dose. Administration of a total of 4 doses of HepB vaccine is recommended when a combination vaccine containing HepB is administered after the birth dose.",
"       <br>",
"        <font class=\"bullet\">",
"         &bull;",
"        </font>",
"        <strong>",
"         Rotavirus (RV) vaccine:",
"        </strong>",
"        <em>",
"         (Minimum age: 6 weeks for both RV1 [Rotarix] and RV5 [RotaTeq])",
"        </em>",
"        Administer a series of RV vaccine to all infants as follows: 1) If RV1 is used, administer a 2-dose series at 2 and 4 months of age. 2) If RV5 is used, administer a 3-dose series at ages 2, 4, and 6 months. 3) If any dose in series was RV5 or vaccine product is unknown for any dose in the series, a total of 3 doses of RV vaccine should be administered.",
"        <br>",
"         &Delta;",
"         <strong>",
"          Diphtheria and tetanus toxoids and acellular pertussis (DTaP) vaccine:",
"         </strong>",
"         <em>",
"          (Minimum age: 6 weeks)",
"         </em>",
"         Administer a 5-dose series of DTaP vaccine at ages 2, 4, 6, 15 to 18 months, and 4 through 6 years. The fourth dose may be administered as early as age 12 months, provided at least 6 months have elapsed since the third dose.",
"         <br>",
"          <font class=\"lozenge\">",
"           &loz;",
"          </font>",
"          <strong>",
"           <em>",
"            Haemophilus influenzae",
"           </em>",
"           type b (Hib) conjugate vaccine:",
"          </strong>",
"          <em>",
"           (Minimum age: 6 weeks)",
"          </em>",
"          Administer a Hib vaccine primary series and a booster dose to all infants. The primary series doses should be administered at 2, 4, and 6 months of age; however, if PRP-OMP (PedvaxHib or Comvax) is administered at 2 and 4 months of age, a dose at age 6 months is not indicated. One booster dose should be administered at age 12 through 15 months. Hiberix (PRP-T) should only be used for the booster (final) dose in children aged 12 months through 4 years, who have received at least 1 dose of Hib.",
"          <br>",
"           <strong>",
"            Vaccination of persons with high-risk conditions:",
"           </strong>",
"           Hib vaccine is not routinely recommended for patients older than 5 years of age. However 1dose of Hib vaccine should be administered to unvaccinated or partially vaccinated persons aged 5 years or older who have leukemia, malignant neoplasms, anatomic or functional asplenia (including sickle cell disease), human immunodeficiency virus (HIV) infection, or other immunocompromising conditions.",
"           <br>",
"            &sect;",
"            <strong>",
"             Pneumococcal conjugate vaccine (PCV):",
"            </strong>",
"            <em>",
"             (Minimum age: 6 weeks)",
"            </em>",
"            Administer a series of PCV13 vaccine at ages 2, 4, 6 months with a booster at age 12 through 15 months. For children aged 14 through 59 months who have received an age-appropriate series of 7-valent PCV (PCV7), administer a single supplemental dose of 13-valent PCV (PCV13).",
"            <br>",
"             <strong>",
"              Vaccination of persons with high-risk conditions:",
"             </strong>",
"             For children aged 24 through 71 months with high risk conditions (listed below), administer 1 dose of PCV13 if 3 doses of PCV were received previously, or administer 2 doses of PCV13 at least 8 weeks apart if fewer than 3 doses of PCV were received previously. Children with high risk conditions aged 2 years or older also should receive pneumococcal polysaccharide vaccine (PPSV23) at least 8 weeks after the last dose of PCV. A single dose of PCV13 may be administered to previously unvaccinated children aged 6 through 18 years who have anatomic or functional asplenia (including sickle cell disease), HIV infection or an immunocompromising condition, cochlear implant or cerebrospinal fluid leak. See MMWR 2010; 59 (No. RR-11), available at",
"             <a href=\"file://www.cdc.gov/mmwr/pdf/rr/rr5911.pdf\" target=\"_blank\">",
"              www.cdc.gov/mmwr/pdf/rr/rr5911.pdf",
"             </a>",
"             .",
"             <br>",
"              <strong>",
"               High risk conditions:",
"              </strong>",
"              1) Immunocompetent children with chronic heart disease (particularly cyanotic congenital heart disease and cardiac failure); chronic lung disease (including asthma if treated with high-dose oral corticosteroid therapy), diabetes mellitus; cerebrospinal fluid leaks; or cochlear implant. 2) Children with anatomic or functional asplenia (including sickle cell disease and other hemoglobinopathies, congenital or acquired asplenia, or splenic dysfunction). 3) Children with immunocompromising conditions: HIV infection, chronic renal failure and nephrotic syndrome, diseases associated with treatment with immunosuppressive drugs or radiation therapy, including malignant neoplasms, leukemias, lymphomas and Hodgkin disease; or solid organ transplantation, congenital immunodeficiency.",
"              <br>",
"               &yen;",
"               <strong>",
"                Pneumococcal polysaccharide vaccine (PPSV23):",
"               </strong>",
"               <em>",
"                (Minimum age: 2 years)",
"               </em>",
"               Administer PPSV23 at least 8 weeks after the last dose of PCV to children aged 2 years or older with high risk conditions (listed above). A single revaccination with PPSV23 should be administered after 5 years to children with anatomic or functional asplenia (including sickle cell disease) or an immunocompromising condition.",
"               <br>",
"                &Dagger;",
"                <strong>",
"                 Inactivated poliovirus (IPV) vaccine:",
"                </strong>",
"                <em>",
"                 (Minimum age: 6 weeks)",
"                </em>",
"                Administer a series of IPV at ages 2, 4, 6 to 18 months, with a booster at age 4 to 6 years. The final dose in the series should be administered on or after the fourth birthday and at least 6 months after the previous dose.",
"                <br>",
"                 &dagger;",
"                 <strong>",
"                  Influenza vaccine:",
"                 </strong>",
"                 <em>",
"                  (Minimum age: 6 months for inactivated influenza vaccine [IIV]; 2 years for live, attenuated influenza vaccine [LAIV])",
"                 </em>",
"                 Administer influenza vaccine annually to all children beginning at age 6 months. For most healthy, nonpregnant persons aged 2 through 49 years, either LAIV or IIV may be used. However, LAIV should NOT be administered to some persons, including 1) those with asthma, 2) children 2 through 4 years who had wheezing in the past 12 months, or 3) those who have any other underlying medical conditions that predispose them to influenza complications. For all other contraindications to use of LAIV see MMWR 2010; 59 (No. RR-8), available at",
"                 <a href=\"file://www.cdc.gov/mmwr/pdf/rr/rr5908.pdf\" target=\"_blank\">",
"                  www.cdc.gov/mmwr/pdf/rr/rr5908.pdf",
"                 </a>",
"                 . Administer 1 dose to persons aged 9 years and older. For children aged 6 months through 8 years: For the 2012-13 season, administer 2 doses (separated by at least 4 weeks) to children who are receiving influenza vaccine for the first time. For additional guidance, follow dosing guidelines in the 2012 ACIP influenza vaccine recommendations, MMWR 2012; 61:613, available at",
"                 <a href=\"file://www.cdc.gov/mmwr/pdf/wk/mm6132.pdf\" target=\"_blank\">",
"                  www.cdc.gov/mmwr/pdf/wk/mm6132.pdf",
"                 </a>",
"                 . For the 2013-14 season, follow dosing guidelines in the 2013 ACIP influenza vaccine recommendations.",
"                 <br>",
"                  **",
"                  <strong>",
"                   Measles, mumps, and rubella (MMR) vaccine:",
"                  </strong>",
"                  <em>",
"                   (Minimum age: 12 months)",
"                  </em>",
"                  Administer the first dose of MMR vaccine at age 12 through 15 months, and the second dose at age 4 through 6 years. The second dose may be administered before age 4 years, provided at least 4 weeks have elapsed since the first dose. Administer 1 dose of MMR vaccine to infants aged 6 through 11 months before departure from the United States for international travel. These children should be revaccinated with 2 doses of MMR vaccine, the first at age 12 through 15 months (12 months if the child remains in an area where disease risk is high), and the second dose at least 4 weeks later. Administer 2 doses of MMR vaccine to children aged 12 months and older, before departure from the United States for international travel. The first dose should be administered on or after age 12 months and the second dose at least 4 weeks later.",
"                  <br>",
"                   <font class=\"double_bullet\">",
"                    &bull;&bull;",
"                   </font>",
"                   <strong>",
"                    Varicella (VAR) vaccine:",
"                   </strong>",
"                   <em>",
"                    (Minimum age: 12 months)",
"                   </em>",
"                   Administer the first dose of VAR vaccine at age 12 through 15 months, and the second dose at age 4 through 6 years. The second dose may be administered before age 4 years, provided at least 3 months have elapsed since the first dose. If the second dose was administered at least 4 weeks after the first dose, it can be accepted as valid.",
"                   <br>",
"                    &Delta;&Delta;",
"                    <strong>",
"                     Hepatitis A (Hep A) vaccine:",
"                    </strong>",
"                    <em>",
"                     (Minimum age: 12 months)",
"                    </em>",
"                    Initiate the 2-dose HepA vaccine series for children aged 12 through 23 months; separate the 2 doses by 6 to 18 months. Children who have received 1 dose of HepA vaccine before age 24 months should receive a second dose 6 to 18 months after the first dose. For any person aged 2 years and older who has not already received the HepA vaccine series, 2 doses of HepA vaccine separated by 6 to 18 months may be administered if immunity against hepatitis A virus infection is desired.",
"                    <strong>",
"                     Special populations:",
"                    </strong>",
"                    Administer 2 doses of HepA vaccine at least 6 months apart to previously unvaccinated persons who live in areas where vaccination programs target older children, or who are at increased risk for infection.",
"                    <br>",
"                     <font class=\"double_lozenge\">",
"                      &loz;&loz;",
"                     </font>",
"                     <strong>",
"                      Meningococcal conjugate vaccines (MCV):",
"                     </strong>",
"                     <em>",
"                      (Minimum age: 6 weeks for (Menhibrix) HibMenCY, 9 months for Menactra [MCV4-D], 2 years for Menveo [MCV4-CRM])",
"                     </em>",
"                     Vaccination of persons with high-risk conditions: For children younger than 19 months of age with anatomic or functional asplenia (including sickle cell disease), administer an infant series of HibMenCY at 2, 4, 6, and 12 to 15 months. For children aged 2 through 18 months with persistent complement component deficiency, administer either an infant series of HibMenCY at 2, 4, 6, and 12 through 15 months or a 2-dose primary series of MCV4-D starting at 9 months, with at least 8 weeks between doses. For children aged 19 through 23 months with persistent complement component deficiency who have not received a complete series of HibMenCY or MCV4-D, administer 2 primary doses of MCV4-D at least 8 weeks apart. For children aged 24 months and older with persistent complement component deficiency or anatomic or functional asplenia (including sickle cell disease), who have not received a complete series of HibMenCY or MCV4-D, administer 2 primary doses of either MCV4-D or MCV4-CRM. MCV4-D should not be administered to a child with asplenia (including sickle cell disease) until 2 years of age and at least 4 weeks after the completion of all PCV13 doses. See MMWR 2011; 60:1391, available at",
"                     <a href=\"file://www.cdc.gov/mmwr/pdf/wk/mm6040.pdf\" target=\"_blank\">",
"                      www.cdc.gov/mmwr/pdf/wk/mm6040.pdf",
"                     </a>",
"                     . For children aged 9 months and older who are residents of or travelers to countries in the African meningitis belt or to the Hajj, administer an age-appropriate formulation and series of MCV4 for protection against serogroups A and W-135. Prior receipt of HibMenCY is not sufficient for children traveling to the meningitis belt or the Hajj. See MMWR 2011; 60:1391, available at",
"                     <a href=\"file://www.cdc.gov/mmwr/pdf/wk/mm6040.pdf\" target=\"_blank\">",
"                      www.cdc.gov/mmwr/pdf/wk/mm6040.pdf",
"                     </a>",
"                     . For children who are present during outbreaks caused by a vaccine serogroup, administer or complete an age- and formulation-appropriate series of HibMenCY or MCV4. For booster doses among persons with high-risk conditions refer to",
"                     <a href=\"file://www.cdc.gov/vaccines/pubs/acip-list.htm#mening\" target=\"_blank\">",
"                      www.cdc.gov/vaccines/pubs/acip-list.htm#mening",
"                     </a>",
"                     .",
"                    </br>",
"                   </br>",
"                  </br>",
"                 </br>",
"                </br>",
"               </br>",
"              </br>",
"             </br>",
"            </br>",
"           </br>",
"          </br>",
"         </br>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Akinsanya-Beysolow I, Jenkins R, Meissner HC, Immunization Services Division, National Center for Immunization and Respiratory Diseases, CDC. Advisory Committee on Immunization Practices (ACIP) Recommended Immunization Schedule for Persons Aged 0 Through 18 Years - United States, 2013. MMWR Surveill Summ 2013; 62:2. Available at:",
"     <a href=\"file://www.cdc.gov/vaccines/schedules/downloads/child/0-18yrs-schedule.pdf\" target=\"_blank\">",
"      www.cdc.gov/vaccines/schedules/downloads/child/0-18yrs-schedule.pdf",
"     </a>",
"     (Accessed on February 3, 2013).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 616px\">",
"   <div class=\"ttl\">",
"    Recommended immunization schedule for persons aged 7 through 18 years - United States, 2013 (for those who fall behind or start late, see the schedule below and the catch-up schedule)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 596px; height: 758px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This schedule includes recommendations in effect as of January 1, 2013. Any dose not administered at the recommended age should be administered at a subsequent visit, when indicated and feasible. The use of a combination vaccine generally is preferred over separate injections of its equivalent component vaccines. Vaccination providers should consult the relevant Advisory Committee on Immunization Practices (ACIP) statement for detailed recommendations, available online at",
"    <a href=\"file://www.cdc.gov/vaccines/pubs/acip-list.htm\" target=\"_blank\">",
"     www.cdc.gov/vaccines/pubs/acip-list.htm",
"    </a>",
"    . Clinically significant adverse events that follow vaccination should be reported to the Vaccine Adverse Event Reporting System (VAERS) at",
"    <a href=\"file://www.vaers.hhs.gov\" target=\"_blank\">",
"     www.vaers.hhs.gov",
"    </a>",
"    or by telephone, 800-822-7967. Suspected cases of vaccine-preventable diseases should be reported to the state or local health department. Additional information including precautions and contraindications for vaccination is available from the CDC online at",
"    <a href=\"file://www.cdc.gov/vaccines\" target=\"_blank\">",
"     www.cdc.gov/vaccines",
"    </a>",
"    or by telephone, 800-232-4636. This schedule is approved by the ACIP, the American Academy of Pediatrics, the American Academy of Family Physicians, and the American College of Obstetricians and Gynecologists.",
"    <div class=\"footnotes\">",
"     *",
"     <strong>",
"      Tetanus and diphtheria toxoids and acellular pertussis (Tdap) vaccine:",
"     </strong>",
"     <em>",
"      (Minimum age: 10 years for Boostrix and 11 years for Adacel)",
"     </em>",
"     Administer 1 dose of Tdap vaccine to all adolescents aged 11 through 12 years. Tdap can be administered regardless of the interval since the last tetanus and diphtheria toxoid-containing vaccine. Administer 1dose of Tdap vaccine to pregnant adolescents during each pregnancy (preferred during 27 through 36 weeks gestation) regardless of number of years from prior Td or Tdap vaccination.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     <strong>",
"      Human papillomavirus (HPV) vaccines (HPV4 [Gardasil] and HPV2 [Cervarix]):",
"     </strong>",
"     <em>",
"      (Minimum age: 9 years)",
"     </em>",
"     Administer a 3-dose series of HPV vaccine on a schedule of 0, 1 to 2, and 6 months to all adolescents aged 11 to 12 years. Either HPV4 or HPV2 may be used for females, and only HPV4 may be used for males. The vaccine series can be started beginning at age 9 years. Administer the second dose 1 to 2 months after the first dose and the third dose 6 months after the first dose (at least 24 weeks after the first dose).",
"     <br/>",
"     &Delta;",
"     <strong>",
"      Meningococcal conjugate vaccines (MCV):",
"     </strong>",
"     <em>",
"      (Minimum age: 9 months for Menactra [MCV4-D], 2 years for Menveo [MCV4-CRM])",
"     </em>",
"     Administer MCV4 vaccine at age 11 to 12 years, with a booster dose at age 16 years. Adolescents aged 11 through 18 years with human immunodeficiency virus (HIV) infection should receive a 2-dose primary series of MCV4, with at least 8 weeks between doses. See MMWR 2011; 60:1018, available at:",
"     <a href=\"file://www.cdc.gov/mmwr/pdf/wk/mm6030.pdf\" target=\"_blank\">",
"      www.cdc.gov/mmwr/pdf/wk/mm6030.pdf",
"     </a>",
"     .",
"     <br/>",
"     <strong>",
"      Vaccination of persons with high-risk conditions:",
"     </strong>",
"     For children aged 24 months and older with persistent complement component deficiency or anatomic or functional asplenia (including sickle cell disease), who have not received a complete series of HibMenCY or MCV4-D, administer 2 primary doses of either MCV4-D or MCV4-CRM. MCV4-D should not be administered to a child with asplenia (including sickle cell disease) until at least 4 weeks after the completion of all PCV13 doses. See MMWR 2011; 60:1391, available at",
"     <a href=\"file://www.cdc.gov/mmwr/pdf/wk/mm6040.pdf\" target=\"_blank\">",
"      www.cdc.gov/mmwr/pdf/wk/mm6040.pdf",
"     </a>",
"     . For children aged 9 months and older who are residents of or travelers to countries in the African meningitis belt or to the Hajj, administer an age-appropriate formulation and series of MCV4 for protection against serogroups A and W-135. Prior receipt of HibMenCY is not sufficient for children traveling to the meningitis belt or the Hajj. See MMWR 2011; 60:1391, available at",
"     <a href=\"file://www.cdc.gov/mmwr/pdf/wk/mm6040.pdf\" target=\"_blank\">",
"      www.cdc.gov/mmwr/pdf/wk/mm6040.pdf",
"     </a>",
"     . For children who are present during outbreaks caused by a vaccine serogroup, administer or complete an age- and formulation-appropriate series of MCV4. For booster doses among persons with high-risk conditions refer to",
"     <a href=\"file://www.cdc.gov/vaccines/pubs/acip-list.htm#mening\" target=\"_blank\">",
"      www.cdc.gov/vaccines/pubs/acip-list.htm#mening",
"     </a>",
"     .",
"     <br/>",
"     <span class=\"lozenge\">",
"      &loz;",
"     </span>",
"     <strong>",
"      Influenza vaccines:",
"     </strong>",
"     <em>",
"      (Minimum age: 6 months for inactivated influenza vaccine [IIV], 2 years for live, attenuated influenza vaccine [LAIV])",
"     </em>",
"     Administer influenza vaccine annually to all children beginning at age 6 months. For most healthy, nonpregnant persons aged 2 through 49 years, either LAIV or IIV may be used. However, LAIV should NOT be administered to some persons, including 1) those with asthma, 2) children 2 through 4 years who had wheezing in the past 12 months, or 3) those who have any other underlying medical conditions that predispose them to influenza complications. For all other contraindications to use of LAIV see MMWR 2010; 59 (No. RR-8), available at",
"     <a href=\"file://www.cdc.gov/mmwr/pdf/rr/rr5908.pdf\" target=\"_blank\">",
"      www.cdc.gov/mmwr/pdf/rr/rr5908.pdf",
"     </a>",
"     . Administer 1 dose to persons aged 9 years and older. For children aged 6 months through 8 years: 1) For the 2012-13 season, administer 2 doses (separated by at least 4 weeks) to children who are receiving influenza vaccine for the first time. For additional guidance, follow dosing guidelines in the 2012 ACIP influenza vaccine recommendations, MMWR 2012; 61: 613, available at",
"     <a href=\"file://www.cdc.gov/mmwr/pdf/wk/mm6132.pdf\" target=\"_blank\">",
"      www.cdc.gov/mmwr/pdf/wk/mm6132.pdf",
"     </a>",
"     ; 2) For the 2013-14 season, follow dosing guidelines in the 2013 ACIP influenza vaccine recommendations.",
"     <br/>",
"     &sect;",
"     <strong>",
"      Pneumococcal conjugate vaccine (PCV):",
"     </strong>",
"     <em>",
"      (Minimum age: 6 weeks)",
"      <br/>",
"     </em>",
"     <strong>",
"      Vaccination of persons with high-risk conditions:",
"     </strong>",
"     A single dose of PCV13 may be administered to previously unvaccinated children aged 6 through 18 years who have anatomic or functional asplenia (including sickle cell disease), HIV infection or an immunocompromising condition, cochlear implant or cerebrospinal fluid leak. See MMWR 2010; 59 (No. RR-11), available at",
"     <a href=\"file://www.cdc.gov/mmwr/pdf/rr/rr5911.pdf\" target=\"_blank\">",
"      www.cdc.gov/mmwr/pdf/rr/rr5911.pdf",
"     </a>",
"     . Administer PPSV23 at least 8 weeks after the last dose of PCV to children aged 2 years or older with high risk conditions (listed below).",
"     <br/>",
"     <strong>",
"      High risk conditions for pneumococcal vaccine:",
"     </strong>",
"     1) Immunocompetent children with chronic heart disease (particularly cyanotic congenital heart disease and cardiac failure); chronic lung disease (including asthma if treated with high-dose oral corticosteroid therapy), diabetes mellitus; cerebrospinal fluid leaks; or cochlear implant. 2) Children with anatomic or functional asplenia (including sickle cell disease and other hemoglobinopathies, congenital or acquired asplenia, or splenic dysfunction). 3) Children with immunocompromising conditions: HIV infection, chronic renal failure and nephrotic syndrome, diseases associated with treatment with immunosuppressive drugs or radiation therapy, including malignant neoplasms, leukemias, lymphomas and Hodgkin disease; or solid organ transplantation, congenital immunodeficiency.",
"     <br/>",
"     &yen;",
"     <strong>",
"      Pneumococcal polysaccharide vaccine (PPSV23):",
"     </strong>",
"     <em>",
"      (Minimum age: 2 years)",
"     </em>",
"     Administer PPSV23 at least 8 weeks after the last dose of PCV to children aged 2 years or older with high-risk conditions (listed above). A single revaccination with PPSV23 should be administered after 5 years to children with anatomic or functional asplenia (including sickle cell disease) or an immunocompromising condition.",
"     <br/>",
"     &Dagger;",
"     <strong>",
"      Hepatitis A (HepA) vaccine:",
"     </strong>",
"     For any person aged 2 years and older who has not already received the HepA vaccine series, 2 doses of HepA vaccine separated by 6 to 18 months may be administered if immunity against hepatitis A virus infection is desired.",
"     <br/>",
"     <strong>",
"      Special populations:",
"     </strong>",
"     Administer 2 doses of HepA vaccine at least 6 months apart to previously unvaccinated persons who live in areas where vaccination programs target older children, or who are at increased risk for infection.",
"     <br/>",
"     &dagger;",
"     <strong>",
"      Hepatitis B (HepB) vaccine:",
"     </strong>",
"     Unvaccinated persons should complete a 3-dose series. A 2-dose series (doses separated by at least 4 months) of adult formulation Recombivax HB is licensed for use in children aged 11 through 15 years.",
"     <br/>",
"     **",
"     <strong>",
"      Inactivated poliovirus (IPV) vaccine:",
"     </strong>",
"     A fourth dose is not necessary if the third dose was administered at age 4 years or older and at least 6 months after the previous dose. If both oral polio vaccine (OPV) and IPV were administered as part of a series, a total of 4 doses should be administered, regardless of the child's current age. IPV is not routinely recommended for US residents aged 18 years or older.",
"     <br/>",
"     <span class=\"double_bullet\">",
"      &bull;&bull;",
"     </span>",
"     <strong>",
"      Measles, mumps, and rubella (MMR) vaccine:",
"     </strong>",
"     Ensure that all school-aged children and adolescents have had 2 doses of MMR vaccine; the minimum interval between the 2 doses is 4 weeks.",
"     <br/>",
"     &Delta;&Delta;",
"     <strong>",
"      Varicella (VAR) vaccine:",
"     </strong>",
"     Ensure that all persons aged 7 through 18 years without evidence of immunity (see MMWR 2007; 56 [No. RR-4], available at",
"     <a href=\"file://www.cdc.gov/mmwr/pdf/rr/rr5604.pdf\" target=\"_blank\">",
"      www.cdc.gov/mmwr/pdf/rr/rr5604.pdf",
"     </a>",
"     ) have 2 doses of varicella vaccine. For children aged 7 through 12 years the recommended minimum interval between doses is 3 months (if the second dose was administered at least 4 weeks after the first dose, it can be accepted as valid); for persons aged 13 years and older, the minimum interval between doses is 4 weeks.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Akinsanya-Beysolow I, Jenkins R, Meissner HC, Immunization Services Division, National Center for Immunization and Respiratory Diseases, CDC. Advisory Committee on Immunization Practices (ACIP) Recommended Immunization Schedule for Persons Aged 0 Through 18 Years - United States, 2013. MMWR Surveill Summ 2013; 62:2. Available at:&nbsp;",
"     <a href=\"file://www.cdc.gov/vaccines/schedules/downloads/child/0-18yrs-schedule.pdf\" target=\"_blank\">",
"      www.cdc.gov/vaccines/schedules/downloads/child/0-18yrs-schedule.pdf",
"     </a>",
"     (Accessed on February 3, 2013).",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
