"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Causes of clitoromegaly",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Condition",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"2\">",
"        Can present",
"       </td>",
"       <td class=\"subtitle1\" rowspan=\"2\">",
"        Comments and reference",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        At birth",
"       </td>",
"       <td class=\"subtitle2\">",
"        After birth",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"4\">",
"        Virilized XX",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Congenital adrenal hyperplasia (CAH)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        21 alpha hydroxylase deficiency and 11 beta hydroxylase deficiency are the most common. Late presentation does occur",
"        <sup>",
"         [1,2]",
"        </sup>",
"        . (See \"Diagnosis of classic congenital adrenal hyperplasia due to 21-hydroxylase deficiency\" and see \"Congenital adrenal hyperplasia due to 11-beta-hydroxylase deficiency\").",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Maternal androgens or synthetic progestational agents",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        (See \"Causes of gestational hyperandrogenism\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Placental aromatase enzyme deficiency",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Maternal virilization during pregnancy can be a clue to the diagnosis. (See \"Diagnosis and management of gestational hyperandrogenism\").",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Androgen-secreting tumors",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Ovarian",
"        <sup>",
"         [3]",
"        </sup>",
"        and adrenal",
"        <sup>",
"         [4]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Hepatic dysfunction",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Report of 10-year-old girl with portal hypertension and impaired hepatic steroid metabolism",
"        <sup>",
"         [5]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Exogenous androgens",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        (Akcam 2003)",
"        <sup>",
"         [6]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"4\">",
"        Feminized XY (not true clitoromegaly, but small penis can appear as large clitoris)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Congenital adrenal hyperplasia (CAH)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Examples include 17 hydroxylase deficiency, 3 beta hydroxysteroid deficiency. (See \"Uncommon causes of congenital adrenal hyperplasia\").",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Androgen insensitivity syndrome (aka testicular feminization syndrome)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Complete insensitivity usually presents at birth, whereas partial insensitivity can present at birth or later",
"        <sup>",
"         [7,8]",
"        </sup>",
"        . (See \"Diagnosis and treatment of disorders of the androgen receptor\").",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        5-alpha reductase deficiency (5aRD)",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        5aR converts testosterone to DHT. (See \"Steroid 5-alpha-reductase 2 deficiency\").",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle3_left\" colspan=\"4\">",
"        Other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        True hermaphroditism",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Patients can be XX or XY. Genitalia can vary from ambiguous to isolated clitoromegaly",
"        <sup>",
"         [9]",
"        </sup>",
"        .",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Mixed gonadal dysgenesis",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Most patients are mosaics 45,XO/46,XY. (See \"Evaluation of the infant with ambiguous genitalia\").",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Neurofibromatosis",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Has been reported both with type 1 and type 2",
"        <sup>",
"         [10]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Vascular malformation",
"       </td>",
"       <td>",
"        TP",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Report of 5-year-old girl",
"        <sup>",
"         [11]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Sebaceous cyst",
"       </td>",
"       <td>",
"        TP",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Case report in adolescent girl",
"        <sup>",
"         [12]",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        Idiopathic",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        Report of two adults with acquired isolated clitoromegaly",
"        <sup>",
"         [13]",
"        </sup>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     TP: theoretically possible but no case report found.",
"    </div>",
